import React, { Component } from 'react'
import { PageHeader, Button, Table, Tag, Space } from 'antd'

const columns = [
    {
        title: '编号',
        dataIndex: 'carriageNumber',
        key: 'carriageNumber',
    },
    {
        title: '级别',
        dataIndex: 'level',
        key: 'level',
    },
    {
        title: '规格',
        dataIndex: 'size',
        key: 'size',
    },
    {
        title: '座位数',
        key: 'seatNumber',
        dataIndex: 'seatNumber',
    },
    {
        title: '价格基数',
        key: 'priceBase',
        dataIndex:'priceBase'
    },
    {
        title: '适配车型',
        key: 'adapter',
       dataIndex:'adapter'
    },
    {
        title: '操作',
        key: 'operation',
        render: () => (
            <Space size="middle">
                <a>编辑</a>
            </Space>
        ),
    },
];

const data = [
    {
        key: '1',
        name: 'John Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
        tags: ['nice', 'developer'],
    },
    {
        key: '2',
        name: 'Jim Green',
        age: 42,
        address: 'London No. 1 Lake Park',
        tags: ['loser'],
    },
    {
        key: '3',
        name: 'Joe Black',
        age: 32,
        address: 'Sidney No. 1 Lake Park',
        tags: ['cool', 'teacher'],
    },
];

export default class Carriage extends Component {
    render() {
        return (
            <div>
                <div>
                    <PageHeader
                        title={<span style={{ fontSize: '30px' }}>车厢管理</span>}
                        subTitle={<Button onClick={this.showDrawer} style={{ marginLeft: '20px' }}>新增</Button>}
                    />
                </div>
                <div>
                    <Table columns={columns} dataSource={data} />
                </div>
            </div>
        )
    }
}
